import React from 'react';

const Footer = (props) => (
  <footer className="app-footer">
    <div>
      <a href="https://systango.com">Systango</a>
      <span>&copy; 2019 Systango Labs.</span>
    </div>
    <div className="ml-auto">
      <span>Powered by</span>
    </div>
  </footer>
);

export default Footer;
